// render dữ liệu trang coffee và trang trà
const renderData = () => {
  //  Tìm hiểu về DOMContentLoaded
  document.addEventListener("DOMContentLoaded", () => {
    const contentDiv = document.querySelector(".section-list");

    if (contentDiv) {
      // Kiểm tra tiêu đề trang hoặc URL để xác định trang hiện tại
      if (document.title === "Coffee") {
        // Nếu là page Coffee thì phải render data này
        var html = "";
        data?.coffee.map((item) => {
          return (html += `
            <div class="section-item">
              <img
                src=${item.image}
              />
              <h2>${item.name}</h2>
              <p>${item.price} đ</p>
              <div class="section-btn">
                <button>Xem chi tiết</button>
                <button>Đặt mua</button>
              </div>
            </div>
            `);
        });
        document.querySelector(".section-list").innerHTML = html;
      } else if (document.title === "Trà") {
        // Nếu là page Trà thì phải render data này

        let html = "";
        data?.tea.map((item) => {
          return (html += `
               <div class="section-item">
                 <img
                   src=${item.image}
                 />
                 <h2>${item.name}</h2>
                 <p>${item.price} đ</p>
                 <div class="section-btn">
                   <button>Xem chi tiết</button>
                   <button>Đặt mua</button>
                 </div>
               </div>
               `);
        });
        document.querySelector(".section-list").innerHTML = html;
      } else if (document.title === "Đồ uống") {
        let html = "";
        data?.drink.map((item) => {
          return (html += `
               <div class="section-item">
                 <img
                   src=${item.image}
                 />
                 <h2>${item.name}</h2>
                 <p>${item.price} đ</p>
                 <div class="section-btn">
                   <button>Xem chi tiết</button>
                   <button>Đặt mua</button>
                 </div>
               </div>
               `);
        });
        document.querySelector(".section-list").innerHTML = html;
      }
    }
  });
};

renderData();
